  formatNumber = function(rawNumber, delimiter, decimal) {
    var partArray, temp;
    if (decimal > 0) {
      temp = roundToTwo(rawNumber);
    } else {
      temp = Math.round(rawNumber);
    }
    partArray = temp.toString().split(".");
    partArray[0] = partArray[0].toString().replace(/\B(?=(\d{3})+(?!\d))/g, delimiter);
    if (delimiter === ",") {
      if (partArray[1] === "00") {
        return partArray[0];
      } else {
        return partArray.join(".");
      }
    } else {
      if (partArray[1] === "00") {
        return partArray[0];
      } else {
        return partArray.join(",");
      }
    }
  };

  formatMillions = function(rawNumber, delimiter, currencyCode) {
    var array, number, temp;
    number = Math.round(rawNumber);
    switch (currencyCode) {
      case "MXN":
      case "ARS":
      case "PEN":
        temp = Math.round(number / 1e6);
        temp = temp.toString().replace(/\B(?=(\d{3})+(?!\d))/g, delimiter);
        array = new Array();
        array["amount"] = temp;
        array["symbolPosition"] = "left";
        if (currencyCode === "PEN") {
          array["prefix"] = "";
          array["suffix"] = "M.";
          array["showCode"] = false;
          return array;
        } else {
          array["prefix"] = "";
          array["suffix"] = "MDP";
          array["showCode"] = true;
          return array;
        }
        break;
      case "USD":
      case "EUR":
      case "GBP":
        temp = Math.round((number / 1e6) * 10) / 10;
        temp = temp.toString().replace(/\B(?=(\d{3})+(?!\d))/g, delimiter);
        array = new Array();
        array["amount"] = temp;
        if (currencyCode === "USD") {
          array["prefix"] = "us";
          array["suffix"] = "M.";
          array["showCode"] = false;
          array["symbolPosition"] = "left";
          return array;
        } else {
          array["prefix"] = "";
          array["suffix"] = "M.";
          array["showCode"] = false;
          array["symbolPosition"] = "right";
          return array;
        }
        break;
      case "CLP":
      case "COP":
        temp = Math.round(number / 1e6);
        temp = temp.toString().replace(/\B(?=(\d{3})+(?!\d))/g, delimiter);
        array = new Array();
        array["amount"] = temp;
        array["prefix"] = "";
        array["suffix"] = "MDP";
        array["showCode"] = true;
        array["symbolPosition"] = "left";
        return array;
    }
  };

